import React from 'react';
import strawberry from '../images/strawberry.svg'
const Catalog = () => {
    return (
        <>
        <div className=" flex flex-col  justify-center items-center font-popins ">
            <div className=" flex bg-pink-cf justify-center items-center rounded-full px-[16px] py-[12px] mt-[3.75rem]">
            <span className="text-[16px] font-medium text-red-cf px-2">More than Faster </span><span><img src={strawberry} alt="strawberry "/></span>
            </div>
            <div className="mt-10 text-center">
                <h1 className="text-black-cf text-3xl font-black leading-9	">
                Groceries delivered in as little as <span className="text-red-cf font-medium"> 2 hours</span>
                </h1>
                <h3 className="text-gray-cf">Grocen atssures fresh grocery every morning to your family without getting out in this pandemic.</h3>
            </div>
        </div>
        </>
    );
};

export default Catalog;
